pragma solidity >=0.4.21 <0.9.0;

contract Wallet {
    address [] public approvers;
    uint public quorum;
    struct Transfer {
        uint id;
        uint amount;
        address payable to;
        uint approvals;
        bool sent;
    }
    Transfer[] public transfers;
    mapping(address => mapping(uint => bool)) public transfersApprovals;

    constructor(address [] memory _approvers, uint _quorum){
        approvers = _approvers;
        quorum = _quorum;
    }

    function getApprovers() external view returns(address[] memory) {
        return approvers;
    }

    function getTransfers() external view returns(Transfer[] memory) {
        return transfers;
    }

    function createTransfer(uint amount, address payable to) onlyApprover() external{
        transfers.push(Transfer(
            transfers.length,
            amount,
            to,
            0,
            false
        ));
    }

    function approveTransfer(uint transferId) onlyApprover() external {
        require(transfers[transferId].sent == false, "Transfer has been already sent");
        require(transfersApprovals[msg.sender][transferId] == false, "Cannot approve transfer twice");

        transfersApprovals[msg.sender][transferId] = true;
        transfers[transferId].approvals++;

        if(transfers[transferId].approvals >= quorum){
            transfers[transferId].sent = true;
            address payable to  = transfers[transferId].to;
            uint amount = transfers[transferId].amount;
            to.transfer(amount);
        }
    }

    receive() external payable{
    }

    modifier onlyApprover(){
        bool allowed = false;
        // Is it better to have a for loop for a list of approvers or a map and have fast access ?
        for(uint i = 0; i < approvers.length; i++){
            if(msg.sender == approvers[i]){
                allowed = true;
            }
        }
        require(allowed == true, "You are not allowed to manage a transaction");
        _;
    }
}
